Nature, Travel Documentary hosted by Paul McGann, published by Discovery Channel in 2014 - English narration


Information
------------------------------

Wildest Indochina
This spectacular series sweeps across the most diverse peninsular in the world. From Malaysia to Southwest China, Vietnam to Cambodia and Thailand this vast area includes outstanding landscapes, historic cities, tropical jungles and armies of animals. With mangroves and mountains, pygmy elephants, turtles and rare birds it is no wonder that the word 'mega-diverse' is now attributed to parts of the region.
South-west of China and east of India lies the Asian peninsula Indochina, which is home to some of the most breath-taking natural wonders. WILDEST INDOCHINA journeys through this exotic location starting with Malaysia which encompasses the giant island of Borneo - the land of majestically languid orang-utans and saltwater crocodiles, then travels North to Thailand which is where the heart of Indochina lies, home to diverse species such as long tailed macaques who survive in this land of extreme geography. Next up is Cambodia which dumbfounds many with its water kingdom and as a result is stricken annually by a huge monsoon; Asian elephants and the Burmese python inhabit this mystical location. See how life has fought back in war-ravaged Vietnam, which contains 10% of the world's species, within a south-eastern Himalayan enclave lies China's secret garden, where half of all Chinese birds and mammals exist.


1)  Malaysia Freaks of Nature 
The diversity of Malaysia is unparalled, especially on the third largest island in the world, Borneo, where orang-utans swing through the trees and giant saltwater crocs lurk.

2)  Thailand Natures Survivors 
The heart of Indochina belongs to Thailand, where diverse species such as tigers and long-tailed macaques survive in this land of extreme geography, and the mega-diverse Malaysia encompasses the giant island of Borneo, the land of majestically languid orang-utans and giant saltwater crocodiles.

3)  Cambodia the Water Kingdom 
Explore Cambodia, one of the most bio-diverse countries in Southeast Asia, whose wildlife and climate is ruled by the impact of the annual monsoon cycle.

4)  Vietnam Phoenix from the Ashes 
Vietnam is the easternmost country on the Indochina peninsula in Southeast Asia, and around 10% of the world's species live here causing its jungles to burst with wildlife.

5)  Chinas Secret Garden 
Around half of China's birds and mammals live in a tiny region in China's southwest corner. Explore this land of snowcapped mountains, temperate valleys and tropical jungles

